class Orders extends Component {
    render() {
        return (
            <div>
                {/* Navbar */}
                <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
                    <div class="container">
                        <a class="navbar-brand" href="#">Shopify App</a>
                    </div>
                </nav>
                &nbsp; &nbsp; &nbsp;

                {/* Orders */}
                <div class="container">
                    <div class="row">
                        <div class="col-sm-12">
                            <div class="card text-center">
                                <div class="card-title"><a href="/orders">Orders</a></div>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Orders
